import React from 'react'
import SingleMessage from './SingleMessage'
export default ({ messages, user }) => {
    return (
        <div className="border border-primary">
           
            { user?(
               
                <ul className="list-group">
                    {
                        Object.values(messages).filter((singleMessage) => singleMessage.userId === user.id).
                            map((singleMessage) => (
                                <SingleMessage message={singleMessage} user={user} key={singleMessage.id} />
                            ))
                    }
                </ul>
            ):
            <h1>please insert register</h1>
            }
        </div>
    )

}
